import { Card, CardImg, CardText, CardBody, CardTitle, CardSubtitle, Button, Container, Label } from 'reactstrap';
const Vendor=({vendor})=>{
    return(



            <Card style={{width:"100%"}, {borderRadius : '1rem'}}>
         <CardBody className="text-center">
             <CardTitle className="font-weight-bold"><b>Medicine name :  {vendor.name}</b></CardTitle>
             <CardText> Quantity : {vendor.phone}</CardText>
             <CardText> Ordered on : {vendor.location}</CardText>
             <CardText> Ordered By : {vendor.email}</CardText>
             <CardText> Ordered By : {vendor.start_date}</CardText>
         </CardBody>
     </Card>

    )
}
export default Vendor;
